(1, 1, 'Arsenal 23/24 Home Shirt', 'arsenal-2324-home-shirt', 'ARSN/HMK/08/23', 'ARSN/HMK/08/23', '<p>Arsenals heritage gets a modern update in the Arsenal 23/24 Home Shirt. Celebrating the 20th anniversary of the Invincibles season, this 23/24 home shirt comes in a bright, new shade of red adorned with lightning bolts and gold details for a sophisticated take on a classic kit. Crafted from breathable recycled polyester, it features an embroidered Club crest, mesh side panels and moisture-absorbing AEROREADY technology for all-day-everyday ease, the Arsenal way.&nbsp;</p><p>This home shirt is made with recycled materials as part of our ambition to help end plastic waste. Make it your own by having your chosen name and number printed on the back. Your shirt, your way. To experience the authentic player fit, including the Invincibles record taping on the sides and innovative sports technology, head over to the 23/24 Authentic Home Shirt.&nbsp;</p><ul><li>Embroidered Club crest&nbsp;</li><li>Slim fit&nbsp;</li><li>Ribbed neck&nbsp;</li><li>Mesh side inserts</li><li>Ribbed cuffs&nbsp;</li><li>Moisture-absorbing&nbsp;</li><li>AEROREADY technology</li></ul>', 5000, 100, 0, 1, 1500.00, 1200.00, 800.00, NULL, 0, 1, '2023-08-11', NULL, NULL, 0.00, 'kg', 0.00, 'cm', 0.00, 'cm', 0.00, 'cm', 0.00, 'l', '2023-08-11 17:10:52', '2023-08-13 12:24:17', 1, '7yyTk5DetzRh215KNjO6n681Xj6ec2-metaMjAyMy5wbmc=-.png', 'M8SxnzYU0e07WbOLjpdWGZFM2bMBbG-metaYmFjay5qcGVn-.jpg', '<p>Arsenals heritage gets a modern update in the Arsenal 23/24 Home Shirt. Celebrating the 20th anniversary of the Invincibles season, this 23/24 home shirt comes in a bright, new shade of red adorned with lightning bolts and gold details for a sophisticated take on a classic kit.&nbsp;</p><p>Crafted from breathable recycled polyester, it features an embroidered Club crest, mesh side panels and moisture-absorbing AEROREADY technology for all-day-everyday ease, the Arsenal way.</p>'),
(2, 1, 'Real Madrid - Mens Home Authentic Shirt 23/24 White', 'real-madrid-mens-home-authentic-shirt-2324-white', 'RLMDRD/08/23', 'RLMDRD/08/23', 'Tradition gets a golden touch in the Real Madrid 23/24 Home Authentic Jersey. Keeping a crisp all-white base, the striking kit continues the thread of powerful design, delivering a sleek, lightweight jersey steeped in legendary soccer history.\n\nWith a nod to older kits, gold accents from previous kits are re-introduced alongside navy framing. An allover, sublimation print is a subtle update to the classic all-white color, complemented by a new soccer silhouette that lets you take the clubs elegance and style off-pitch. HEAT.RDY fabric maximises airflow so you can feel cool  while the embroidered crest and \"Hala Madrid!\" on the neck shows off your winning mentality.', 5000, 100, 0, 1, 1500.00, 1200.00, 800.00, NULL, 0, 1, '2023-08-11', NULL, NULL, 0.00, 'kg', 0.00, 'cm', 0.00, 'cm', 0.00, 'cm', 0.00, 'l', '2023-08-11 17:24:12', '2023-08-12 11:25:00', 4, 'bim2pVpckf5qBN2OSkDr1ryRUnDBTq-metacmVhbC1qZXJzZXkucG5n-.png', 'elRim40TbOF5Xa3XtLBY0kfwd7tf95-metaUk1DRk1aMDEyN18wM19lZTkxMTM1Ny02MmYyLTRkMzUtYTg2Mi1mZGM5ZDg1YjI4NDZfNTAweDQ4MC53ZWJw-.webp', NULL);
